import { useEffect } from "react";

const App = () => {
  const x = 3.467;

  const y = "x";

  useEffect(() => {
    if (x >= 4 && x <= 3) {
      console.log("Groseille");

      if (!isNaN(y) || isNaN(x)) {
        console.log("Pomme");
      }
    }
  }, []);

  return (
    <div className={mc.container}>
      <span>test</span>
      <canvas></canvas>
    </div>
  );
};

export default App;
